window.bookSummaryJSON = "<p><i>Oracle 2: The Dreamland Murders</i> is a gripping psychological thriller series follow-up to Andrew Pyper’s audiobook <i>Oracle</i>. Performed by an ensemble cast with Joshua Jackson, Devon Bostick, and Humberly Gonzalez, Pyper's high-stakes thrill ride continues the journey of FBI agent Nate Russo as he tracks an elusive serial killer and discovers an ancient curse. This time, Russo’s unique psychic gifts and killer instincts will lead him to the secrets of an idyllic New England village, and to Dreamland—the abandoned amusement park built on something evil that refuses to stay buried.</p>"; 
